const storName = {
    num: null,
    list: null,
    score: null
}

const reducers = (state = storName, action) => {
    switch (action.type) {
        case "ADD":
            return Object.assign(state, {
                num: state.num.concat(action.num),
                list: null,
                score: null
            })

        default:
            return state
    }
}

export default reducers;
